import { Homepage, Footer, Navbar } from "./components/components";
import { Route, Routes } from "react-router";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<Homepage />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
